USE meta_search;

create table if not exists airport
(
    id   bigint auto_increment
        primary key,
    code varchar(5)   null,
    name varchar(255) null,
    constraint UK_kpeoje7ewxy99k1wt4cmttjgd
        unique (code)
)
    engine = MyISAM;

create table if not exists hibernate_sequence
(
    next_val bigint null
)
    engine = MyISAM;

create table if not exists provider
(
    id   bigint auto_increment
        primary key,
    code varchar(10)  null,
    name varchar(255) null,
    constraint UK_fql8wc9usg5icu8ngn40oqf5j
        unique (code)
)
    engine = MyISAM;

create table if not exists schedule
(
    id             bigint auto_increment
        primary key,
    departure_code varchar(255) null,
    arrival_code   varchar(255) null,
    provider_code  varchar(255) null,
    base_price     int          null
)
    engine = MyISAM;










